import React, { useState } from "react";
import VideoComponent from "./VideoPlaylist/VideoComponent";

function DigitalProgramming() {
    const DigitalProgrammingData = [
        {
                YoutubeId: "C1a1TK_2KPA", category: "YA", Tags: "#Halloween"
        }
    ];

    
    function ProgrammingDataRow({data})
    {
        return (
            <div>
              {data.YoutubeId} - {data.category}
            </div>
          );
    }

    function ShowDigitalProgrammingData({data})
    {
         const programmingDataRows = [];
         DigitalProgrammingData.forEach((data) => {
            programmingDataRows.push(
            <ProgrammingDataRow 
                data={data} 
                key={data.YoutubeId} />
            );
        });
        return (programmingDataRows);
    }

    return (
        <div className="DigitalProgramming">
            <h1> DigitalProgramming Page </h1>
            <VideoComponent />
            {/* <ShowDigitalProgrammingData data={DigitalProgrammingData} />  */}
        </div>
    );
}

export default DigitalProgramming;
